  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Back Bay NWR
  outlines Refuge accomplishments from September through December of 1946. The report
  begins by summarizing the weather conditions, water conditions, and food and cover
  during this period. Wildlife- including migratory birds, upland game birds, furbearers,
  predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
  and maintenance section discusses physical developments and plantings. The public
  relations section of the report describes recreational uses, Refuge visitors, hunting,
  fishing, and violations. N-R forms are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
